script: |
  super -f tsv -I q11113.sql | sort > q11113.out

vector: true

inputs:
  - name: q11113.sql
    data: |
      SELECT ALL + col1 + - 29 + - col1 AS col1 FROM tab1 WHERE + 92 NOT BETWEEN ( + ( + - col1 ) * + + ( - 53 ) ) AND NULL;
  - name: tab1

outputs:
  - name: q11113.out
    data: |
      -29
      -29
      -29
